import React, { useState } from "react";
import '../assets/styles/ProjectArchive.scss';
import { ProjectData, Project } from '../data/projects'; // Import both data and interface

function ProjectArchive() {
  const [filter, setFilter] = useState<string>('All');

  const categories = ['All', 'Data Engineer', 'Software Engineer'];

  // Map display categories to actual project categories
  const categoryMap: { [key: string]: string } = {
    'All': 'All',
    'Data Engineer': 'Data Science',
    'Software Engineer': 'Software Engineering'
  };

  const filteredProjects = filter === 'All' 
    ? ProjectData.filter((p: Project) => p.category !== 'Game Dev')
    : ProjectData.filter((p: Project) => p.category === categoryMap[filter]);

  return (
    <div className="project-archive-container" id="projects">
      <h1>Project</h1>

      <div className="filter-bar">
        {categories.map((cat: string) => (
          <button 
            key={cat} 
            className={filter === cat ? 'active' : ''}
            onClick={() => setFilter(cat)}
          >
            {cat}
          </button>
        ))}
      </div>

      <div className="project-grid">
        {filteredProjects.map((project: Project, index: number) => (
          <div className="project-card" key={index}>
            <div className="image-container">
              <img src={project.image} alt={project.title} />
              <div className="overlay">
                <a href={project.link} target="_blank" rel="noreferrer">View Live</a>
              </div>
            </div>
            <div className="card-content">
              <span className="category-tag">{project.category}</span>
              <h3>{project.title}</h3>
              <p>{project.description}</p>
              <div className="tech-tags">
                {project.tech.map((t: string) => <span key={t}>#{t}</span>)}
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}

export default ProjectArchive;
